import "./blog.css";

export default function Blogs() {
  return (
    <>
      <div className="head">
        <h1 className="font"> Blogs </h1>
      </div>
      <div className="blog-body">
        <div className="blog-des">
          <h1>Latest News</h1>
        </div>
        <div className="blog-card"></div>
      </div>
    </>
  );
}
